import { GoogleLogin, GoogleOAuthProvider } from "@react-oauth/google";


function Login()
{
    return (
        <div style={{background: "#dcf3ff"}} >
            <GoogleOAuthProvider>
                <GoogleLogin theme="filled_blue"  shape="circle"
                />
            </GoogleOAuthProvider>
        </div>
    );
}

export default Login;
